#include<iostream>using namespace std;   string solve(string &s){       int one=0;      int zero=0;       for(char &i:s)      {            if(i=='1')one++;else zero++;      }       if(zero==0||one==0)return "NET";       int pair=min(zero,one);       if(pair%2==0)return "NET";      else return "DA"; }   int main(){         int t;      cin>>t;        while(t-- > 0)      {           string s;           cin>>s;            cout<<solve(s)<<endl;                }          return 0;}